import Link from 'next/link';


const Navbar = () => (
<div>
    <Link href="/">
    <a>Home</a>
    </Link>
    <Link href="/about">
    <a>About</a>
    </Link>
    <style jsx>{`
        a {
            color: red;
        }
    `} </style>
</div>

);
  
  export default Navbar;
